import React from 'react';
import { Container, Typography, Button } from '@mui/material';
import { useHistory } from 'react-router-dom';
import './ThankYou.css';

const ThankYou = () => {
    const handleRedirect = () => {};

    return (
        <Container maxWidth="sm" className="thank-you-container">
            <Typography variant="h3" gutterBottom className="thank-you-text">
                Thank You for Your Purchase!
            </Typography>
            <Typography variant="h6" gutterBottom className="thank-you-subtext">
                We appreciate your business. Your order is being processed.
            </Typography>
            <Button
                variant="contained"
                color="primary"
                onClick={handleRedirect}
                className="home-button"
            >
                Go to Home Page
            </Button>
        </Container>
    );
};

export default ThankYou;
